window.bookSummaryJSON = "<p><b>Turns out, I'm not the only supernatural in the world....</b></p> <p>My new werewolf boyfriend, Logan Smith, wants to introduce me to the supernatural community - a secret society of magical species that live in hiding in the human world. But my introduction doesn't go as planned.</p> <p>On the night before my arrival, a terrifying event births a new power inside me. It's cold, powerful, and worst of all, I lose my livelihood overnight since I can't touch anyone now without killing them.</p> <p>Now as I enter the community, while terrified of hurting innocents, I learn that to stop the dark power I must dig into my family's past to uncover the truth of who I really am.</p> <p>Thankfully, I have Logan to help me along the way. Not only is he sinfully delicious, but he's loyal, trustworthy, and is committed to staying at my side. Or so I thought...</p> <p><b>Contains mature themes.</b></p>"; 
